23 may 2012

Voodoo has a strange condition; perhaps it's a blessing. His narcoleptic tendencies send him regularly into incredibly delusional
fantasies that grow increasingly more difficult to distinguish from real life. So when Voodoo meets his old college professor's sexy-ass girlfriend
at a barbecue, you better believe he had the time of his life!

